import { Navbar, NavbarBrand } from 'reactstrap';

export default function Navigation() {
    return (
        <div>
            <Navbar color="dark" dark >
                <div className="container">
                    
                </div>
                <NavbarBrand href="/" >My Restaurant </NavbarBrand>
            </Navbar>
        </div>
    )
}
